import React, {useState} from 'react';
import './App.css';
import Body from './components/Body';
import Eyes from './components/Eyes';
import Hair from './components/Hair';
import Avatar from './components/Avatar';

function App() {
  return (
    <div className="App">
      <Body />
      <Hair />
      <Eyes />
      <Avatar />
    </div>
  );
}

export default App;
